    "environmental-assessment-potential-additions-to-san-francisco-bay-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "The U.S. Fish and Wildlife Service proposes
    to acquire up to 20,000 acres of lands, marshes, tidal flats, salt ponds, submerged
    lands, and open waters in the south San Francisco Bay area to add to the existing
    refuge as authorized and funded by Congress. A combination of fee title, conservation
    easement, lease, and cooperative agreement acquisition would be used to protect
    the habitat. The area encompassing the potential additions is located in and around
    South San Francisco Bay, in Alameda, San Mateo, and Santa Clara Counties, extending
    from a few miles north of the San Mateo Bridge to the extreme south end of the bay.
    The reason for proposing to expand the refuge by approximately 20,000 acres is to
    enhance the purposes for which the refuge was originally established.",nt"license_title":
